post_text:
SJPL offers regular virtual tech assistance for those who have questions about various tech including:
• laptops;
• WiFi;
• hotspots;
• Google Meets;
• and more

Tech assistance sessions are available at various times Monday through Friday, as well as held in SPANISH and VIETNAMESE.

Open to customers of all ages. No SJPL card required to make an appt! Registration required.

Please go to the site below to register for a session.

https://sjpl.bibliocommons.com/events/search/q=tech%2C%20assistance

